import React from 'react';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
// import { Position } from '@react-pdf-viewer/core';
// import { Line } from '@react-pdf/renderer';

pdfMake.vfs = pdfFonts.pdfMake.vfs;


  const drapeauBase64 = 'data:image/png;base64,';

  const GeneratePDF = (props) => {
    let TotalNb = 0;
    function removeEspace(text){
      return text.replace(/\s+/g, ' ')
    }

    function capitalizeThis(text){
      let lowerText = text.toLowerCase();
      return lowerText.charAt(0).toUpperCase()+lowerText.slice(1);
    }
    const generatePdfDocument = () => {
      const docDefinition = {
        content: [          
            
          {
            image: drapeauBase64,
            width: 140,
            alignment: 'center',
            margin: [0, 0, 0, 0]
          },
          { text: '\n\n\n\n' },
          
          {
            columns: [

              {
                text: [
                  { text: 'MINISTERE DE L\'ECONOMIE ET DES FINANCES\n', style: 'title' },
                  { text: '----------\n', style: 'subheader' },

                  { text: 'SECRETARIAT GENERAL\n', style: 'subheader' },
                  { text: '----------\n', style: 'subheader' },
                  { text: 'DIRECTION GENERALE DU BUDGET ET DES FINANCES\n', style: 'subheader' },
                  { text: '----------\n', style: 'subheader' },
                  { text: 'DIRECTION DE LA SOLDE ET DES PENSIONS\n', style: 'subheader' },
                  { text: '----------\n', style: 'subheader' },
                  { text: 'Service Régional de la Solde et des Pensions\n', style: 'subheader' },
                  { text: 'VATOVAVY\n', style: 'subheader' },
                  { text: '--oOo--\n', style: 'small' },
                  { text: '_____________________', style: 'small' }
                ],
                alignment: 'center',
                margin: [0, 0, 0, 20]
              },
              {
                text: [
                  {
                    text: 'Mananjary, le \n\n',
                    alignment: 'center',
                    margin: [0, 0, 0, 0],
                    bold: false,
                    fontSize: 11
                  },
                  { text: 'LE CHEF DE SERVICE REGIONAL DE LA SOLDE ET DES\n', style: 'subheader' },
                  { text: 'PENSIONS VATOVAVY\n\n', style: 'subheader' },
                  { text: 'À\n\n', style: 'small' },
                  { text: 'Monsieur LE CHEF DE SERVICE DE L\'ORDONNANCEMENT DES DEPENSES DES PENSIONS\n', style: 'subheader' },
                  { text: '\n-ANTANANARIVO-', style: 'subheader' },
                ],
                alignment: 'center',
                margin:  [0, -25.7, 0, 0]
              }
            ]
          },
          { text: '\n\nN°: '+ 208 + '/24-MEF/SG/DGBF/SRSP-VATOVAVY', fontSize: 10, alignment:'left' },
          { text: 'BORDEREAU D\'ENVOI', fontSize: 14, alignment:'center', margin: [0, 10, 0,0], bold: true },
          { text: '______________________', fontSize: 14, alignment:'center', margin: [0, -14.5, 0,0], bold: true },
          { text: '\n' },
        {
          table: {
            headerRows: 1,
            widths: [260, 35, 30, 30, 30, 110],
            body: [
              [{text :'NOM ET PRENOMS', alignment: 'center', bold: true}, { text: 'IM / N° Pension', alignment: 'center', bold: true, fontSize: 9},{text: 'MVT',alignment: 'center', bold: true},
              {text: 'BILL',alignment: 'center', bold: true}, {text: 'NB',alignment: 'center', bold: true}, { text: 'OBSERVATION', alignment: 'center', bold: true}],

              ...props.tabState.map((t) => {
                const nom = removeEspace(t.cle.nom);
                const prenoms = capitalizeThis(t.cle.prenoms);
                TotalNb += t.cle.nb;
                return[
                  { text: `${nom} ${prenoms}` , fontSize: 9, alignment:'left' },
                  { text: `${t.cle.im}`, fontSize: 9, alignment:'center' },
                  { text: `${t.cle.mouvement}` , fontSize: 9, alignment:'center' },
                  { text: `${t.cle.bill}` , fontSize: 9, alignment:'center' },
                  { text: `${t.cle.nb}` , fontSize: 9, alignment:'center' },
                  
                  { text: ``, fontSize: 9, border: [ true, false, true, false] }
                ]
              }),

            [{text :'TOTAL', alignment: 'center', bold: true}, { text: '', bold: true, alignment: 'center'},{ text: '', bold: true, alignment: 'center'},{ text: '', bold: true, alignment: 'center'},{text: TotalNb, bold: true, alignment: 'center'}, { text: '', bold: true, border: [true, false, true, true]}],
            ],
          },
          layout: {
            hLineWidth: function(i, node) {

              return 1; // Autres lignes
            },
            vLineWidth: function(i, node) {
              // Garder les lignes verticales
              return 1; // Lignes verticales pour toutes les colonnes
            }
          }
        },

        ],
        styles: {
          header: { fontSize: 10, bold: false, alignment: 'center' },
          subheader: { fontSize: 10, bold: false, alignment: 'center' },
          title: { fontSize: 10, bold: false, alignment: 'center' },
          small: { fontSize: 10, alignment: 'center' }
        }
      };
  
      // pdfMake.createPdf(docDefinition).download('document.pdf');
      pdfMake.createPdf(docDefinition).open();

    };
  
    return (
      <div>
        <button className='btn btn-outline-success mt-4 me-2' onClick={generatePdfDocument}>Télécharger PDF</button>
      </div>
    );
  };
  
  export default GeneratePDF;